const DUMMY_MEALS = [
    {
        id: 'm1',
        name: 'Vegan Pizza',
        description: 'Real italian pizza made in pizza oven with vegan cheese',
        price: 20.99,
    },
    {
        id: 'm2',
        name: 'Vegan Schnitzel',
        description: 'A german specialty, but made out of tempeh',
        price: 16.5,
    },
    {
        id: 'm3',
        name: 'Pastrami Burger',
        description: 'Our most famous burger - satisfies even our most demanding clients.',
        price: 14.99,
    },
    {
        id: 'm4',
        name: 'Cesar Salad',
        description: 'Healthy salad... but instead of chicken, you get tofu.',
        price: 16.99,
    },
];

export default DUMMY_MEALS;
